import React from "react";

function DeckList({ decks, deckSelected }) {
    return decks.map((deck) => (
        <div key={deck.id} className="card mb-2">
            <div className="card-body">
                <h2>{deck.name}</h2>
                <p>{deck.description}</p>
                <a href={`/`} className="btn btn-secondary mr-1" onClick={() => deckSelected(deck.id)}>View</a>
                <a href={`/decks/${deck.id}/study`} className="btn btn-primary">Study</a>
            </div>
        </div>
    ));
}

export default DeckList;
